Class1-Q:
آب و هوا ساری در دو روز آینده چگونه است؟ 
//شاخص آلودگی هوا تهران الان چقدر است؟
//سرعت باد در البرز امروز چقد بود؟
//رطوبت هوا گیلان در روز گذشته چقد بوده است؟
//دمای هوا اهواز فردا چقدر پیش بینی میشود؟
//آیا هوا فردا ابری است؟

Class1-W:
آب و هوا-دو روز آینده-ساری
//شاخص آلودگی هوا-تهران-الان
//سرعت باد-البرز-امروز
//رطوبت هوا-گیلان-روز گذشته
//دمای هوا-اهواز-فردا
//هوا-فردا-ابری

Class2-Q:
اذان صبح ساری فردا چه ساعتی است؟
//غروب آفتاب تهران امروز چه زمانی است؟
//طلوع خورشید فردا در مسکو در چه ساعتی است؟
//اذان مغرب فردا به افق لندن چه زمانی است؟
//اختلاف زمانی بین اذان صبح تبریز با اذان صبح مشهد چقدر است؟

Class2-W:
اذان صبح-ساری-فردا
//غروب آفتاب-تهران-امروز
//طلوع خورشید-فردا-مسکو
//اذان مغرب-فردا-لندن
//اختلاف زمانی-اذان صبح تبریز-اذان صبح مشهد

Class3-Q:
ساعت رسمی مالزی در حال حاضر چند است؟
//اختلاف زمانی مشهد و فیلیپین چقدر است؟
//الان در فنلاند چه زمانی است؟
//اختلاف ساعت میان دو شهر هانبورگ آلمان و سالوادور برزیل چقدر است؟

Class3-W:
ساعت رسمی-مالزی-حال حاضر
//اخلاف زمانی-مشهد-فیلیپین
//فنلاند-الان-زمان
//اختلاف ساعت-هانبورگ آلمان-سالوادور برزیل

Class4-Q:
۲ ژوئن ۲٠٠۱ در تاریخ شمسی چه روزی است؟
//۱۱ محرم ۱۴۲۱ به میلادی چه تاریخی است؟
//هفته بسیج در چه تاریخی است؟
//مبعث رسول در چه تاریخ قمری است؟
//روز جهانی پسر در چه ماه میلادی است؟

Class4-W:
۲ ژوئن ۲٠٠۱-شمسی
//۱۱ محرم ۱۴۲۱-میلادی
//هفته بسیج-تاریخ
//مبعث رسول-تاریخ قمری
//روز جهانی پسر-ماه میلادی
